// GitHubUtil.js

export const fetchGitHubProjects = async () => {
    try {
      const response = await fetch('https://api.github.com/users/kdotmanoj/repos');
      if (!response.ok) {
        throw new Error('Failed to fetch GitHub projects');
      }
      const data = await response.json();
      // Filter repositories based on specific criteria
      const filteredProjects = data.filter(repo => {
        // Replace with your own criteria, e.g., repository name or other properties
        return repo.name === 'Quiz-Game'; // Example: Filter by repository name 'Quiz-Game'
      });
      return filteredProjects;
    } catch (error) {
      console.error('Error fetching GitHub projects:', error);
      return [];
    }
  };
